import React, { Component } from 'react';
import './Gigs.css'
import { Link } from "react-router-dom";

class GigsCard extends Component {
  render() {
    return (
      <div className="card">
          <p className="gigName">Gig Name: {this.props.gig.gig}</p>
          <p className="gigDate">Gig Date: {this.props.gig.date}</p>
            <img src={require('./charlieChaplin.png')} alt="Chaplin" />
          <p className="setRating">Set Rating: {this.props.gig.rating}</p> 
          <p className="setSpot">Type Of Spot: {this.props.gig.spot}</p>
          <p className="venue">Venue Name: {this.venue}</p>
          <picture>
          </picture>
          <button type="button" onClick={() => this.props.deleteGig(this.props.gig.id)}>Delete Gig</button>
          <button type="button" onClick={() => {this.props.history.push(`/gigs/${this.props.gig.id}/edit`)}}>Edit</button>
          </div>
    );
  }
}

export default GigsCard;
